Correct syntax for document_id in Logstash Elasticsearch Output<p>So I'm trying to use logstash to move data from MongoDB to elasticsearch. I don't want duplicates to be written, so I'm using the <code>doc_as_upsert =&gt; true</code> along with the <code>document_id</code> parameters in the output. This is my config file for logstash</p>

<pre><code>input {
  jdbc{
    jdbc_driver_class =&gt; "com.dbschema.MongoJdbcDriver"
    jdbc_driver_library =&gt; "/path/to/mongojdbc1.8.jar"
