embedfield:
MongoDB query pairs in big collection<p>I just recently started using MongoDB trying to solve a domain specific problem an got stuck trying to self join a big collection. I have a database with well over 10 million documents, each containing adress elements to an entity (person, organisation, mailbox for an organisation etc.). Note that each depth (for example street) can occur more than once to store some varying information like aliases or depth specific ids. I have no schema restrictions and can change it if it helps solving the question.</p>

<p>The data looks like this:</p>

<pre><code>{
  "some_info": "xyz",
  "tags": {
    "HOUSE_NUMBER": [
      {
        "id": "23.45678",
        "value": "18",
        "attributes": ["NU"]
      }
    ],
    "FORENAME": [
      {
        "id": "34.56789",
        "value": "MAX",
        "attributes": ["XQ4", "M"]
      },
      {
        "id": "45.67890",
        "value": "X65732862",
        "attributes": ["XID"]
      }
    ],
    "STREET": [
      {
        "id": "56.789012",
        "value": "RICHMOND STREET",
        "attributes": []
      }
    ],
    "...": []
  }
}
</code></pre>

<p>I want to query for pairs in the collection, for example "find all pairs of persons with the same forename living in the same street", or "find all pairs of persons and organisations having at least 3 words in common living in the same city". My current query for the first problem looks something like this:</p>

<pre><code>db.collection_name.aggregate([
    {$unwind: "$tags.STREET"},
    {$unwind: "$tags.FORENAME"},
    {
        $match: {
            "tags.FORENAME.attributes": {$nin: ["XID", "NA"]}
        }
    },
    {
        $lookup: {
            from: "collection_name",
            localField: "tags.STREET.id",
            foreignField: "tags.STREET.id",
            as: "joined"
        }
    },
    {$unwind: "$joined"},
    {$unwind: "$joined.tags.FORENAME"},
    {
        $match: {$expr: {$ne: ["$tags.FORENAME.id", "$joined.tags.FORENAME.id"]}}
    },
    {
        $match: {$expr: {$eq: ["$tags.FORENAME.value", "$joined.tags.FORENAME.value"]}}
    }
], {
    allowDiskUse: true
})
</code></pre>

<p>I created indices on tags.STREET.id, tags.FORENAME.id, tags.FORENAME.attributes and tags.FORENAME.value.</p>

<p>The problem with this is the execution time. I just can't get to an acceptable level, the above mentioned query takes 3.5 minutes for 500 results on my machine. For comparison, my PostgreSQL database (with specifically created views and indices for the problem) only takes a few seconds.</p>

<p>How can I speed up this kind of queries? Is MongoDB even suitable for this kind of problem?</p>

